A nova denominao do evento 222  Enquadramento / Reenquadramento / Desenquadramento de ME/EPP;

Selecionar o enquadramento de porte da empresa (ME, EPP, Demais) de acordo com a expectativa de Receita Bruta Anual.

O porte informado deve estar compatvel com a Receita Bruta auferida no anocalendrio anterior. Assim, durante a prtica do evento 222, caso seja solicitado reenquadramento como ME ou EPP, para perodo que j possua informao de porte atualizada pela RFB com resultado diferente do informado na aplicativo de coleta, a solicitao ser indeferida.

A data do evento  a data do registro da Declarao de Enquadramento / Reenquadramento / Desenquadramento no rgo de Registro, conforme Tabela VIII;

O evento 222 somente poder ser praticado por estabelecimento matriz;

Somente as naturezas jurdicas 206-2, 207-0, 208-9, 213-5, 223-2, 224-0, 225-9, 226-7, 230-5 e 231-3 exigem o enquadramento de Porte da Empresa. Para estas naturezas jurdicas, o porte pode ser ME ou EPP. Para o restante das naturezas jurdicas, o porte deve ser Demais.

Para anlise e deferimento do evento 222, ser exigido que o contribuinte apresente a Declarao de Enquadramento / Reenquadramento ou Desenquadramento, registrada pelo rgo de Registro. Caso a referida declarao no seja recente, tambm dever ser exigida a Certido Simplificada do rgo de Registro, com o objetivo de comprovar o enquadramento atual da empresa naquele rgo.

CAPTULO III
DA SITUAO CADASTRAL SUSPENSA

Art. 36. A inscrio no CNPJ  enquadrada na situao cadastral suspensa quando, conforme o caso, a entidade ou o estabelecimento filial:

I - domiciliada no exterior, encontrando-se na situao cadastral ativa, deixar de ser alcanada, temporariamente, pelas situaes previstas no inciso XV do art. 4;

II - solicitar baixa de sua inscrio no CNPJ, enquanto a solicitao estiver em anlise ou caso seja indeferida;

III - for intimada na forma prevista no  1 do art. 29;

IV - for intimada na forma prevista no  1 do art. 40;

V - apresentar indcio de interposio fraudulenta de scio ou titular, na situao prevista no  2 do art. 3 do Decreto n 3.724, de 10 de janeiro de 2001, enquanto o respectivo processo estiver em anlise;

VI - interromper temporariamente suas atividades;

VII - no reconstituir, no prazo de 210 (duzentos e dez) dias, a pluralidade de scios do seu QSA;

VIII - tiver sua suspenso determinada por ordem judicial; ou

IX - possuir inconsistncia(s) em seus dados cadastrais.

 1 A suspenso da inscrio no CNPJ nas hipteses previstas nos incisos I e VI do caput ocorre por solicitao da entidade ou do estabelecimento filial, conforme o caso, mediante comunicao da interrupo temporria de suas atividades, na forma prevista nos arts. 12 a 14.

 2 A inconsistncia cadastral a que se refere o inciso IX do caput caracteriza-se, conforme o caso, pela:

I - ausncia do representante a que se refere o art. 7 ou quando sua inscrio no CPF for inexistente ou estiver cancelada ou nula;

II - ausncia do QSA, no caso das entidades relacionadas no Anexo VI desta Instruo Normativa;

III - ausncia do ente federativo responsvel, no caso de entidades da Administrao Pblica;

IV - ausncia da atividade econmica;

V - ausncia ou invalidade do Cdigo de Endereamento Postal (CEP);

VI - ausncia do valor do capital social, para as entidades cuja informao  obrigatria; ou

VII - incompatibilidade entre o Nmero de Inscrio no Registro de Empresa (Nire) e a natureza jurdica da entidade.

